import React from "react";

function FlowCard({ flow }) {
  return (
    <div className="flow-card">
      <p>{flow?.src_ip} - {flow?.dst_ip}</p>
      <p>Predicted: {flow?.pred_label}</p>
    </div>
  );
}

export default FlowCard;
